import React, { useState } from 'react'
import Hamburger from 'hamburger-react'
import { link } from 'motion/react-client';
const Hamburgercomponents = () => {
    const [open,setopen] = useState();
  return (
    <div>
      <Hamburger
      size={18}
      toggled = {open}
      toggle={setopen}
      />
      {open&&
      <Link to="/">Home</Link>
      }
    </div>
  )
}

export default Hamburgercomponents
